import React from "react";
import { useState } from 'react'
import '../styles/sections/Affiliateprofile.css'

function Affiliateprofile() {

    const [profile, setProfile] = useState("https://scontent.fcrk3-1.fna.fbcdn.net/v/t39.30808-6/287825759_2021439201389784_2663061212977595522_n.jpg?_nc_cat=107&ccb=1-7&_nc_sid=09cbfe&_nc_eui2=AeHUOJ5Eto2mDxJzXVLYrCo8TKcasVkT5iFMpxqxWRPmIS40rxjS9EcXcWTf1Fv3BbTrENl_1B-rhwXR01nUZPPa&_nc_ohc=BZh9bqrQ96QAX_lcXHa&_nc_ht=scontent.fcrk3-1.fna&oh=00_AfAJpu-3XXM_bTOKiegLt0umNgTR1a3m8_Fs1uHlXLGrPA&oe=64A96412")
    const [firstname, setFirstname] = useState();
    const [lastname, setLastname] = useState();
    const [email, setEmail] = useState();
    const [birthdate, setBirthdate] = useState();
    const [province, setProvince] = useState();
    const [editview, setEditview] = useState(true)

    return (
        <div class="affiliateprofile-container">
            <div class="affiliateprofile-info-container">
                <div class="affiliateprofile-info-block">
                    <img alt="profile" class="affiliateprofile-info-image" src={profile}></img>
                    <div class="affiliateprofile-info-data">
                        <div className='affiliate-landingpage-two-fields'>
                            <div className='affiliate-landingpage-field'>
                                <label for='affiliate-register-firstname'>First Name:</label>
                                {editview ? <input type="text" >firstname</input> : firstname}
                            </div>
                            <div className='affiliate-landingpage-field'>
                                <label for='affiliate-register-lastname'>Last Name:</label>
                                <input readonly type='text' id='affiliate-register-lastname'></input>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
            <div class="affiliateprofile-social-container">
                Social container
            </div>
        </div>
    );
}

export default Affiliateprofile
